import Menu from '../components/Menu';
import React from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Jumbotron, Container, Row, Col } from 'reactstrap';

const About = (data) => (
    
        <div>
            <Menu />
            <Jumbotron fluid className="top">
                <style>{`.top {
                        padding-top: 80px;
                        padding-botton: 80px;
                        background-color: #000;
                        color: #fff;
                        margin-bottom: 0rem !import;
                    }`}
                </style>
                <Container>
                    <div className="text-center">
                        <h1 className='display-4'>Sobre a Empresa</h1>
                    </div>
                </Container>
            </Jumbotron>
            <Jumbotron fluid className="about">
                <style>{`.about {
                        padding-top: 80px;
                        padding-botton: 80px;
                        background-color: #fff;
                        margin-bottom: 0rem !import;
                    }
                    .featurette-divider {
                        margin: 5rem 0;
                    }    
                    `}
                </style>
                <Container>
                    <div>
                        <div className="row featurette">
                            <div className="col-md-7 order-md-2">
                                <h2 className="featurette-heading">Oh yeah, itâ€™s that good. <span className="text-muted">See for yourself.</span></h2>
                                <p className="lead">Donec ullamcorper nulla non metus auctor fringilla. Vestibulum id ligula porta felis euismod semper. Praesent commodo cursus magna, vel scelerisque nisl consectetur. Fusce dapibus, tellus ac cursus commodo.</p>
                            </div>
                            <div className="col-md-5 order-md-1">
                                <img src="/image1.jpg" alt="foto 1" className="bd-placeholder-img bd-placeholder-img-lg featurette-image img-fluid mx-auto" width="500" height="500" />
                            </div>
                        </div>
                    </div>
                    <hr className="featurette-divider"></hr>
                    <div>
                        <div className="row featurette">
                            <div className="col-md-7">
                                <h2 className="featurette-heading">And lastly, this one. <span className="text-muted">Checkmate.</span></h2>
                                <p className="lead">Donec ullamcorper nulla non metus auctor fringilla. Vestibulum id ligula porta felis euismod semper. Praesent commodo cursus magna, vel scelerisque nisl consectetur. Fusce dapibus, tellus ac cursus commodo.</p>
                            </div>
                            <div className="col-md-5 order-md-1">
                                <img src="/image1.jpg" alt="foto 1" className="bd-placeholder-img bd-placeholder-img-lg featurette-image img-fluid mx-auto" width="500" height="500" />
                            </div>
                        </div>
                    </div>
                </Container>
            </Jumbotron>
        </div>
);

About.getInitialProps = async () => {
   var response = await axios.get('http://localhost:8080/about/')
   console.log(response)
   return {response: response.data}
}


export default About
